import React from 'react';
import MyNav from "./MyNav";
import {Link} from 'react-router-dom';
import "../styles/navbar.css";
import IconButton from "@material-ui/core/IconButton";
import SearchIcon from "@material-ui/icons/Search";

function myFunction() {
    var x = document.getElementById("myTopnav");
    if (x.className === "topnav") {
        x.className += " responsive";
    } else {
        x.className = "topnav";
    }
}
const Navbars = () => {
    const responsive=document.getElementById("myTopnav");
    
    return(
    <div>
        <nav className=" navbar-expand-sm navbar-light">
            <div className="topnav" >
                <Link to="/"> <img alt="logo" src="/assert/logo.png" className="navbar-logo"/></Link>
                <div className="collapse navbar-collapse">
                    <div className="navbar-nav" id="myTopnav">
                        <MyNav address="/" isExact={true} label="آگهی من"/>
                        <MyNav address="/chat" isExact={true} label="چت"/>
                        <MyNav address="/about" isExact={true} label="درباره ما"/>
                        <MyNav address="/bolg" isExact={true} label="بلاگ"/>
                        <MyNav address="/help" isExact={true} label="پشتیبانی و قوانین"/>
                        <MyNav address="/contact" isExact={true} label="تماس با ما"/>
                        <MyNav address="/new" isExact={true} label="ثبت آگهی"/>
                        <form className="form-inline my-2 my-lg-0">
                            <input className="form-control mr-sm-2" type="search" placeholder="جستجو"
                                   aria-label="Search"/>
                            <IconButton className="iconButton">
                                <SearchIcon/>
                            </IconButton>
                        </form>
                        <a href="#about">About</a>
                        <a href="javascript:void(0);" style="font-size:15px;" className="icon"
                           onClick="myFunction()">&#9776;</a>
                    </div>
                </div>


            </div>
        </nav>


    </div>
);
}
export default Navbars;
